/* #define DISABLE_INDENTATION to disable indentation of subvalues */
#ifndef DISABLE_INDENTATION
#define DO_ZERO_INDENT Indent_Level = 0;
#define DO_INC_INDENT Indent_Level++;
#define DO_DEC_INDENT --Indent_Level;
#define DO_PRINT_INDENT(s) ossPrint(world, "%*s", (Indent_Level - (s[1] == '}')) << 1, "");
#define DO_PUSH_INDENT int indentlevel = Indent_Level;
#define DO_POP_INDENT Indent_Level = indentlevel;
#define DO_BEGIN_WRAP_LINK_STR(elem, len, width) if (elem && len > width)\
		ossPrint(world, "\n%*s", (++Indent_Level << 1) - 1, "");
#define DO_BEGIN_WRAP_STR(len, width) if (len > width)\
		ossPrint(world, "\n%*s", (++Indent_Level << 1) - 1, "");
#define DO_WRAP_STR(pos, width) if (pos > 0 && (pos & (width - 1)) == 0)\
		ossPrint(world, "\n%*s", Indent_Level << 1, ""); else
#define DO_END_WRAP_STR(len, width) if (len > width) Indent_Level--;

static int Indent_Level;
#else
#define DO_ZERO_INDENT
#define DO_INC_INDENT
#define DO_DEC_INDENT
#define DO_PRINT_INDENT(s)
#define DO_PUSH_INDENT
#define DO_POP_INDENT
#define DO_BEGIN_WRAP_LINK_STR(elem, len, width)
#define DO_BEGIN_WRAP_STR(len, width)
#define DO_WRAP_STR(pos, width)
#define DO_END_WRAP_STR(len, width)
#endif

